import React from "react";
import TextInput from "./TextInput";
import DropDown from "./Dropdown";

function StampForm(props) {
  const {
    jobName,
    setJobName,
    jobCode,
    setJobCode,
    boxFolder,
    setBoxFolder,
    preparedFor,
    setPreparedFor,
    preparedBy,
    setPreparedBy,
    date,
    setDate,
    isRevision,
    setIsRevision,
    jobPhase,
    setJobPhase,
    gradientStyle,
    setGradientStyle,
    dateFormat,
    setDateFormat,
    revisionNumber,
    setRevisionNumber,
  } = props;

  return (
    <div>
      <p>Stamp Form</p>
      <TextInput
        label="Job Name"
        value={jobName}
        onChange={(e) => setJobName(e.target.value)}
      />
      <TextInput
        label="Job Code"
        value={jobCode}
        onChange={(e) => setJobCode(e.target.value)}
      />
    </div>
  );
}

export default StampForm;
